import React from 'react';
import { useEffect, useState } from 'react';
import { Link } from "react-router-dom";

function Order() {
    const [orders, setOrder] = useState([]);

    const getOrder = async (e) => {
        const response = await fetch("http://localhost:8000/order", { method: "GET" })
        const data = await response.json()
        setOrder(data);
        // console.log(data);
    }
    useEffect(() => {
        getOrder();
    }, [orders]);

    const handleDelete = async (id) => {
        const data = await fetch("http://localhost:8000/order/" + id, { method: "delete" })
        console.log(data);
        // console.log(id);
    };

    return (
        <div>
            <div className='ms-5'>
                <div>

                    <table className="table border border-1 w-50" >
                        <thead>

                            <tr>
                                <th scope="col">User Id</th>
                                <th scope="col">Name</th>
                                <th scope="col">Address</th>
                                <th scope="col">Product Name</th>
                                <th scope="col">Edit order</th>
                                <th scope="col">Delete order</th>
                            </tr>
                        </thead>

                        <tbody>

                            {orders.map(order =>
                                <tr key={order._id}>
                                    <td>{order._id}</td>
                                    <td>{order.Name}</td>
                                    <td>{order.Address}</td>
                                    <td>{order.Product}</td>
                                    {/* <td><UpdateData id={user._id} email={user.email} password={user.password} onClick={() => handleDelete(user._id)}></UpdateData></td> */}
                                    <td><Link to={`/update/${order._id}`} className='btn btn-primary'>Update</Link></td>
                                    <td><button className="btn btn-danger" onClick={() => handleDelete(order._id)}>Delete</button></td>
                                </tr>
                            )}

                        </tbody>
                    </table>
                </div>

                <div>
                    <h2>Sign Up</h2>
                    <form onSubmit={handleSubmit}>

                        <label htmlFor="name">Name</label>
                        <input type="name" id="name" name="name" onChange={handleForm} />

                        <label htmlFor="email">Email</label>
                        <input type="email" id="email" name="email" onChange={handleForm} />

                        <label htmlFor="password">Password</label>
                        <input type="password" id="password" name="password" onChange={handleForm} />

                        <button type="submit" className='subtn'>Sign Up</button>
                    </form>
                </div>
            </div>

        </div >
    )
}

export default Order
